script: |
  super -f text -I q1817.spq | sort > q1817.out

inputs:
  - name: q1817.spq
    data: |
      SELECT DISTINCT - col0 FROM tab2 (FORMAT parquet) WHERE + - col2 * + col2 * - col2 NOT BETWEEN 4 AND - ( col0 );
  - name: tab2

outputs:
  - name: q1817.out
    data: |
      -46
      -64
      -75
